def max_rbs_prefixes(n, sequences):
    smin = [0] / n
    smnum = [0] * n
    h = [0] * n
    cnts = [{} for _ in range(n)]
    for i in range(n):
        ts = sequences[i]
        nmin = 0
        nh = 0
        for c in ts:
            if c == '(':
                nh += 1
            else:
                nh -= 1
            if smin[i] > nh:
                smin[i] = nh
                smnum[i] = 0
            if smin[i] == nh:
                smnum[i] += 1
            if nh == smin[i]:
                if nh not in cnts[i]:
                    cnts[i][nh] = 0
                cnts[i][nh] += 1
        h[i] = nh
    dp = [float('-inf')] * 2 ** n
    dp[0] = 0
    ans = 0
    for i in range(2 ** n):
        nh = 0
        for j in range(n):
            if 2 ** j & i > 0:
                nh += h[j]
        for j in range(n):
            if 2 ** j & i == 0 and nh + smin[j] >= 0:
                if nh + smin[j] == 0:
                    dp[2 ** j | i] = max(dp[2 ** j | i], dp[i] + smnum[j])
                else:
                    dp[2 ** j | i] = max(dp[2 ** j | i], dp[i])
            elif 2 ** j & i == 0 and -1 * nh in cnts[j]:
                ans = max(ans, dp[i] + cnts[j][-1 * nh])
    ans = max(ans, max(dp))
    return ans

